pragma solidity ^0.4.24;
contract class33{
    //函數外面的參數，默認為storage
   uint x;
   uint y = 10;

    struct fruit{
        uint id;
        string name;
   }

   fruit[12] public fruitarray;

   function example1(uint i,string n)public{
        fruit storage fruit1 = fruitarray[0];
        fruit1.id = i;
        fruit1.name = n;
    }

    function example2(uint i,string n)public view{
        //不會改變鏈上資訊
        fruit memory fruit1 = fruitarray[0];
        fruit1.id = i;
        fruit1.name = n;
    }
}
